import React, { Component } from "react";

class Users extends Component {
  constructor() {
    super();
    console.log("constructor");
  }
  componentDidMount() {
    console.log("componentDidMount");
  }
  render() {
    console.log("render");
    return <div>User1234</div>;
  }
}

export default Users;
